`,paraId:240,tocIndex:48},{value:"2\u3001\u57FA\u7840\u4F7F\u7528",paraId:241,tocIndex:48},{value:"\u5B9E\u73B0\u6B65\u9AA4\uFF1A",paraId:242,tocIndex:48},{value:"\u5BFC\u5165\u5FC5\u8981\u7684\u8DEF\u7531 router \u5185\u7F6E\u7EC4\u4EF6",paraId:243,tocIndex:48},{value:"\u521B\u5EFA React \u7EC4\u4EF6",paraId:243,tocIndex:48},{value:"\u6309\u7167\u8DEF\u7531\u7684\u89C4\u5219\u8FDB\u884C\u8DEF\u7531\u914D\u7F6E",paraId:243,tocIndex:48},{value:`// \u5F15\u5165\u5FC5\u8981\u7684\u5185\u7F6E\u7EC4\u4EF6
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

// \u51C6\u5907\u4FE9\u4E2A\u8DEF\u7531\u7EC4\u4EF6

const Home = () => <div>this is home</div>;
const About = () => <div>this is about</div>;

function App() {
  return (
    <div className="App">
      {/* \u6309\u7167\u89C4\u5219\u914D\u7F6E\u8DEF\u7531 */}
      <BrowserRouter>
        <Link to="/">\u9996\u9875</Link>
        <Link to="/about">\u5173\u4E8E</Link>
        //\u8DEF\u7531\u51FA\u53E3
        <Routes>
          <Route path="/" element={<Home />}></Route>
          <Route path="/about" element={<About />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
`,paraId:244,tocIndex:48},{value:"3. \u6838\u5FC3\u5185\u7F6E\u7EC4\u4EF6\u8BF4\u660E",paraId:245,tocIndex:48},{value:"BrowerRouter",paraId:246,tocIndex:48},{value:"\u4F5C\u7528: \u5305\u88F9\u6574\u4E2A\u5E94\u7528\uFF0C\u4E00\u4E2A React \u5E94\u7528\u53EA\u9700\u8981\u4F7F\u7528\u4E00\u6B21",paraId:247,tocIndex:48},{value:"\u6A21\u5F0F: HashRouter( \u54C8\u5E0C\u6A21\u5F0F ) BrowerRouter( history \u6A21\u5F0F )",paraId:248,tocIndex:48},{value:"Link",paraId:249,tocIndex:48},{value:"\u4F5C\u7528: \u7528\u4E8E\u6307\u5B9A\u5BFC\u822A\u94FE\u63A5\uFF0C\u5B8C\u6210\u58F0\u660E\u5F0F\u7684\u8DEF\u7531\u8DF3\u8F6C \u7C7B\u4F3C\u4E8E ",paraId:250,tocIndex:48},{value:"<router-link/>",paraId:250,tocIndex:48},{value:"\u8FD9\u91CC to \u5C5E\u6027\u7528\u4E8E\u6307\u5B9A\u8DEF\u7531\u5730\u5740\uFF0C\u8868\u793A\u8981\u8DF3\u8F6C\u5230\u54EA\u91CC\u53BB\uFF0CLink \u7EC4\u4EF6\u6700\u7EC8\u4F1A\u88AB\u6E32\u67D3\u4E3A\u539F\u751F\u7684 a \u94FE\u63A5",paraId:251,tocIndex:48},{value:"Routes",paraId:252,tocIndex:48},{value:"\u4F5C\u7528: \u63D0\u4F9B\u4E00\u4E2A\u8DEF\u7531\u51FA\u53E3\uFF0C\u7EC4\u4EF6\u5185\u90E8\u4F1A\u5B58\u5728\u591A\u4E2A\u5185\u7F6E\u7684 Route \u7EC4\u4EF6\uFF0C\u6EE1\u8DB3\u6761\u4EF6\u7684\u8DEF\u7531\u4F1A\u88AB\u6E32\u67D3\u5230\u7EC4\u4EF6\u5185\u90E8\u7C7B\u6BD4 router-view",paraId:253,tocIndex:48},{value:"Route",paraId:254,tocIndex:48},{value:"\u4F5C\u7528: \u7528\u4E8E\u5B9A\u4E49\u8DEF\u7531\u8DEF\u5F84\u548C\u6E32\u67D3\u7EC4\u4EF6\u7684\u5BF9\u5E94\u5173\u7CFB [element\uFF1A\u56E0\u4E3A react \u4F53\u7CFB\u5185 \u628A\u7EC4\u4EF6\u53EB\u505A react element]",paraId:255,tocIndex:48},{value:"\u5176\u4E2D path \u5C5E\u6027\u7528\u6765\u6307\u5B9A\u5339\u914D\u7684\u8DEF\u5F84\u5730\u5740\uFF0Celement \u5C5E\u6027\u6307\u5B9A\u8981\u6E32\u67D3\u7684\u7EC4\u4EF6",paraId:256,tocIndex:48},{value:"4. \u7F16\u7A0B\u5F0F\u5BFC\u822A",paraId:257,tocIndex:48},{value:"\u58F0\u660E\u5F0F \u3010 Link to\u3011 vs \u7F16\u7A0B\u5F0F \u3010\u8C03\u7528\u8DEF\u7531\u65B9\u6CD5\u8FDB\u884C\u8DEF\u7531\u8DF3\u8F6C\u3011",paraId:258,tocIndex:48},{value:"\u6982\u5FF5: \u901A\u8FC7 js \u7F16\u7A0B\u7684\u65B9\u5F0F\u8FDB\u884C\u8DEF\u7531\u9875\u9762\u8DF3\u8F6C\uFF0C\u6BD4\u5982\u8BF4\u4ECE\u9996\u9875\u8DF3\u8F6C\u5230\u5173\u4E8E\u9875",paraId:259,tocIndex:48},{value:"\u5B9E\u73B0\u6B65\u9AA4\uFF1A",paraId:260,tocIndex:48},{value:"\u5BFC\u5165\u4E00\u4E2A useNavigate \u94A9\u5B50\u51FD\u6570",paraId:261,tocIndex:48},{value:"\u6267\u884C useNavigate \u51FD\u6570 \u5F97\u5230 \u8DF3\u8F6C\u51FD\u6570",paraId:261,tocIndex:48},{value:"\u5728\u4E8B\u4EF6\u4E2D\u6267\u884C\u8DF3\u8F6C\u51FD\u6570\u5B8C\u6210\u8DEF\u7531\u8DF3\u8F6C",paraId:261,tocIndex:48},{value:`// \u5BFC\u5165useNavigate\u51FD\u6570
